history.provenance:
Owned by the Carthusian monks at Buxheim (). While Hilprand Brandenburg bequeathed c. 450 books to the monks at Buxheim before his death in , Collijn questions that this manuscript could have been among these; he speculates that Hilprand's bookplate () may instead have been inserted by a later antiquarian (
                                Collijn (1945)

                            ).

msItem.note:
The life of St Birgitta, constituting the readings of Birger Gregersson's office, has sometimes been transmitted independently of the rest of the office (see 
                                        Undhagen 

                                    ) and is found here as a separate item.

note.p:
The bull ends with the colophon of the confirmation of Pope Martinus V, dated here 15 July 1419 (cf. 
    BHL

): Nulli ergo omnino hominum liceat hanc pacinam nostre approbationis confirmationis et communicionis infringere vel ei ausu temerario contraire Si quis autem hoc attemptare presumpserit indignacionem omnipotentis dei et beatorum petri et pauli apostolorum eius se noverit incursurum Datum florencie in idibus July pontificatus nostri anno 2:o (Cf. 
    SDHK

)
